import React,{Component} from "react"
import Modal from "react-modal"




class Modal1 extends Component{
    
    constructor(){
        super();
        this.state = {
            isActive: false
        }
    }

    componentWillMount(){
        Modal.setAppElement('body');
    }

    showmodal = () => {
        this.setState({
        isActive : !this.state.isActive
        })
    }
    
    render(){
        return(
            <div>
                <head>
	<meta name="viewport" content="width=device-width, initial-scale=1"/>
	<meta name="viewport" content="width=device-width, initial-scale=1"/>
	<link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"/>
	<link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.3.1/css/all.css" integrity="sha384-mzrmE5qonljUremFsqc01SB46JvROS7bZs3IO2EmfFsd15uHvIt+Y8vEf7N7fWAU" crossorigin="anonymous"/>
		<link href="https://fonts.googleapis.com/css?family=Farro|Aldrich|Dosis|Montserrat|Qwigley|Righteous|Marck+Script|Roboto+Mono&display=swap" rel="stylesheet"/>
                
          <link  rel="stylesheet" type="text/css" href="modals/modal1/index.css"/> 
                </head>

    

<button id="myBtn" className="btn btn-primary" onClick = {this.showmodal}>Open Modal</button>

<Modal isOpen={this.state.isActive} 
                onRequestClose = {this.state.isActive}>
<div id="myModal" className="modal">

  <div className="modalContent">
  	<div className="modalHeader d-flex justify-content-between align-items-center">
	    <span id="closebtn"><i className="fas fa-times" /></span>
	    
  	</div>
    <p className="modalBody text-center">Do you want to request for demo?</p>
    <hr/>
    <div className="modalFooter d-flex justify-content-end align-items-center">
	    <button type="button" className="modalButton" onClick={this.showmodal}>Request Demo</button>
	</div>
  </div>
 </div>
 </Modal>

<script src="https://code.jquery.com/jquery-3.3.1.slim.min.js" integrity="sha384-q8i/X+965DzO0rT7abK41JStQIAqVgRVzpbzo5smXKp4YfRvH+8abtTE1Pi6jizo" crossorigin="anonymous"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js" integrity="sha384-UO2eT0CpHqdSJQ6hJty5KVphtPhzWj9WO1clHTMGa3JDZwrnQq4sF86dIHNDz0W1" crossorigin="anonymous"></script>
<script src="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/js/bootstrap.min.js" integrity="sha384-JjSmVgyd0p3pXB1rRibZUAYoIIy6OrQ6VrjIEaFf/nJGzIxFDsf4x0xIM+B07jRM" crossorigin="anonymous"></script>
<script
  			src="https://code.jquery.com/jquery-3.4.1.js"
  			integrity="sha256-WpOohJOqMqqyKL9FccASB9O0KwACQJpFTUBLTYOVvVU="
  			crossorigin="anonymous"></script> 
<script src="modals/modal1/script.js"></script>

            </div>
        )
            
        

        }
}


export default Modal1
